import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';
import {
  Container, Grid, Typography, Card, CardContent, CardMedia, Checkbox, FormControlLabel,
  Tabs, Tab, Menu, MenuItem, Button
} from '@mui/material';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';

const subcategories = {
  base: ['Full Door', 'Door Drawer', 'Drawers'],
  wall: ['Single Door', 'Double Door', 'Glass Door'],
  tall: ['Pantry', 'Utility']
};

const App = () => {
  const [cabinets, setCabinets] = useState([]);
  const [selectedCabinets, setSelectedCabinets] = useState([]);
  const [category, setCategory] = useState('base');
  const [subcategory, setSubcategory] = useState('');
  const [anchorEl, setAnchorEl] = useState(null);

  useEffect(() => {
    axios.get('http://localhost:5000/api/cabinets')
      .then(response => {
        setCabinets(response.data);
      })
      .catch(error => {
        console.error("There was an error fetching the cabinets!", error);
      });
  }, []);

  const handleSelection = (cabinetId) => {
    setSelectedCabinets(prev =>
      prev.includes(cabinetId) ? prev.filter(id => id !== cabinetId) : [...prev, cabinetId]
    );
  };

  const handleSubmit = () => {
    axios.post('http://localhost:5000/api/cabinets/selections', { cabinetIds: selectedCabinets });
  };

  const handleCategoryChange = (event, newCategory) => {
    setCategory(newCategory);
    setSubcategory('');
  };

  const handleSubcategoryClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleSubcategoryClose = (subcat) => {
    setAnchorEl(null);
    setSubcategory(subcat);
  };

  return (
    <Container>
      <Typography variant="h3" gutterBottom>Kitchen Catalog</Typography>
      <Tabs value={category} onChange={handleCategoryChange} aria-label="category tabs">
        <Tab label="Base Cabinets" value="base" />
        <Tab label="Wall Cabinets" value="wall" />
        <Tab label="Tall Cabinets" value="tall" />
      </Tabs>
      <Button
        aria-controls="subcategory-menu"
        aria-haspopup="true"
        onClick={handleSubcategoryClick}
        endIcon={<ArrowDropDownIcon />}
      >
        {subcategory || "Select Subcategory"}
      </Button>
      <Menu
        id="subcategory-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={() => handleSubcategoryClose('')}
      >
        {subcategories[category].map(subcat => (
          <MenuItem key={subcat} onClick={() => handleSubcategoryClose(subcat)}>
            {subcat}
          </MenuItem>
        ))}
      </Menu>
      <Grid container spacing={3}>
        {cabinets.filter(cabinet => cabinet.type === category).map(cabinet => (
          <Grid item xs={12} sm={6} md={4} key={cabinet._id}>
            <Card>
              <div style={{ width: 256, height: 256, overflow: 'hidden', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                <CardMedia
                  component="img"
                  style={{ maxWidth: '100%', maxHeight: '100%' }}
                  image={cabinet.image_url}
                  alt={cabinet.name}
                />
              </div>
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  {cabinet.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {cabinet.description}
                </Typography>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={selectedCabinets.includes(cabinet._id)}
                      onChange={() => handleSelection(cabinet._id)}
                    />
                  }
                  label="Select"
                />
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
      <Button variant="contained" color="primary" onClick={handleSubmit} style={{ marginTop: '20px' }}>
        Save Selection
      </Button>
    </Container>
  );
};

export default App;
